import ItemCategory from "./ItemCategory";

const RestaurantDishes = ({ restaurantMenuItems }) => {
    const ItemCategoryType = "type.googleapis.com/swiggy.presentation.food.v2.ItemCategory";
    const NestedItemCategoryType = "type.googleapis.com/swiggy.presentation.food.v2.NestedItemCategory";
    return (
    restaurantMenuItems?.map((item, index) => {
        const info = item?.card?.card;
        console.log(info);
        if(info["@type"] === ItemCategoryType) {
            return <ItemCategory key={index} title={info.title} itemCards={info.itemCards}/>
        }
        // else if(info["@type"] === NestedItemCategoryType) {
        //     return <NestedItemCategory key={index} title={info.title} categories={info.categories} />
        // }
    })
  )
}

